import logo from '../logo.svg';
import '../App.css';
import Navbar from '../Navbar/Navbar';

function Profil() {

    return (
      <div className="App">
        <Navbar />
        <div class="maDiv">
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fhtml.com%2Fattributes%2Fimg-src%2F&psig=AOvVaw2v0GpSSzO1HKrlStNJ5qrv&ust=1677683115430000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCOiTkuO-uP0CFQAAAAAdAAAAABAE" alt="Description de l'image" style="max-width: 100%; max-height: 100%;"/>
      <p>Voici une description de l'image</p>
        </div>
      </div>
    );
  }
  

export default Profil;
